import { Component } from 'react'
import { Row, Col, Radio, Select, Layout } from 'antd';
import Utilities from '@/utilities';

const { Option } = Select;
const { Header, Footer, Sider, Content } = Layout;

class Add extends Component {

    constructor(props) {
        super(props)
        this.utility = new Utilities();
    }

    render(h) {
        return (
            <div id={'addSection'}>
                <Layout>
                    <Layout>
                        <Content>
                            <Row>
                                <Col span={8}>
                                    <label>Mən:</label> <br />
                                    <Radio.Group defaultValue="b" buttonStyle="solid">
                                        <Radio.Button value="b">Satıram</Radio.Button>
                                        <Radio.Button value="a">Kirayə Verirəm</Radio.Button>
                                    </Radio.Group>
                                </Col>
                                <Col span={8}>
                                    {this.utility.selectGenerator("Kategoriya:", [], "Category", null, null, true, false)}
                                </Col>
                                <Col span={8}>
                                    {this.utility.selectGenerator("Şəhər:", [], "City", null, null, true, false)}
                                </Col>
                            </Row>
                            <Row>
                                <Col span={8}>
                                    {this.utility.selectGenerator("Rayon:", [], "Region", null, null, true, false)}
                                </Col>
                                <Col span={8}>
                                    {this.utility.selectGenerator("Qəsəbə:", [], "Village", null, null, true, false)}
                                </Col>
                                <Col span={8}>
                                    {this.utility.selectGenerator("Metro:", [], "Metro", null, null, true, false)}
                                </Col>
                            </Row>
                            <Row>
                                <Col span={8}>
                                    {this.utility.selectGenerator("Kirayə müddəti:",[], "RentType",null,null,true,false)}
                                </Col>
                                <Col span={8}>
                                    {this.utility.inputGenerator("Qiymət")}
                                </Col>
                                <Col span={8}></Col>
                            </Row>
                        </Content>
                    </Layout>
                    <Sider width={'25%'}>Sider</Sider>
                </Layout>

            </div>
        )
    }
}

export default Add;
